import DropDown from '../dropdown/DropDown'
import DropDown2 from '../dropdown2.0/DropDown2.0'
import Logo from '../logo/Logo'

import './Blayout.css'

class Blayout extends  Component {



    	render(){
    		return( <div>
    				   	<div className= 'logo-container'>
	    	    		     <Logo onRouteChange = {this.props.onRouteChange} />
	    	    		</div>
    	    		<div className = 'box-container'>

	    	    		    <div className = 'drops-container'>
	    	    		<div className = 'drop-1'>
			    	    		 <DropDown onChange = {this.change} 
			    		           items = {[
			    		          {value: 'BarberShop', id: 0},
			    		          {value: 'ParloSalon', id: 1},
			    		          ]}

			    		          onBgChange = {this.props.onBgChange}
			    	    		 />
	    	    		</div>

	    	    		     <div className = 'drop-2'>
			    	    		<DropDown2
			    		           items = {[
			    		          {value: 'barber 1', id: 0},
			    		          {value: 'barber 2', id: 1},
			    		          ]}
			        	    		 />
	    	    		</div>
    	    		</div>



    	    		 </div>
    	    		 </div>

    	    	)
    	}





}


export default Blayout;
